import { Link } from 'react-router-dom';
import Layout from '../../constant/layout/layout';
import Modal from '../modal';

const Index = () => {
    return (
        <div>
           homeage
            <Link to='/login'>
            login</Link>
             <Link to='/signup'>
            signup</Link>

           < button onClick={toggleModalCover}>
               open 
           </button>
           <Modal/>
        </div>
    );
};

export default Index;
